const e=JSON.parse('{"key":"v-1ed447e6","path":"/posts/2020-10-25-dpc_watchdog_violation.html","title":"真·DPC_WATCHDOG_VIOLATION 蓝屏解决方案","lang":"zh-CN","frontmatter":{"title":"真·DPC_WATCHDOG_VIOLATION 蓝屏解决方案","date":"2020-10-25T00:00:00.000Z","category":["系统"],"tag":["蓝屏"],"star":true,"order":-30,"description":"DPC_WATCHDOG_VIOLATION 蓝屏原因，多为硬件驱动问题。可是，只有驱动出现大规模报错，厂家才会更新并推送解决方法。 因此，你在网上搜到的解决方案，大多是过时的，并不能解决你的问题。蓝屏原因千奇百怪，通过分析 dmp 蓝屏日志才能彻底解决蓝屏。 导出蓝屏日志 安装 WinDbg Preview，这是微软官方推出的系统 Debug 工具。 启动 WinDbg Preview，软件会自动检测到最新 dmp 日志，点击 Yes 即可载入。如果想分析其他文件，打开文件夹 C:\\\\Windows\\\\Minidump，导出日志 *.dmp。 载入日志过程中，WinDbg Preview 会自动下载所需文件，不需要管。载入完成后，点击 !analyze -v，分析具体日志。 分析日志：日志前半部分都是套话（可忽略），蓝屏原因多在日志最下方几行，分析尾部日志来找出引发蓝屏的进程。注意不要强删未知文件。","head":[["meta",{"property":"og:url","content":"https://newzone.top/posts/2020-10-25-dpc_watchdog_violation.html"}],["meta",{"property":"og:site_name","content":"LearnData-开源笔记"}],["meta",{"property":"og:title","content":"真·DPC_WATCHDOG_VIOLATION 蓝屏解决方案"}],["meta",{"property":"og:description","content":"DPC_WATCHDOG_VIOLATION 蓝屏原因，多为硬件驱动问题。可是，只有驱动出现大规模报错，厂家才会更新并推送解决方法。 因此，你在网上搜到的解决方案，大多是过时的，并不能解决你的问题。蓝屏原因千奇百怪，通过分析 dmp 蓝屏日志才能彻底解决蓝屏。 导出蓝屏日志 安装 WinDbg Preview，这是微软官方推出的系统 Debug 工具。 启动 WinDbg Preview，软件会自动检测到最新 dmp 日志，点击 Yes 即可载入。如果想分析其他文件，打开文件夹 C:\\\\Windows\\\\Minidump，导出日志 *.dmp。 载入日志过程中，WinDbg Preview 会自动下载所需文件，不需要管。载入完成后，点击 !analyze -v，分析具体日志。 分析日志：日志前半部分都是套话（可忽略），蓝屏原因多在日志最下方几行，分析尾部日志来找出引发蓝屏的进程。注意不要强删未知文件。"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:updated_time","content":"2022-12-17T03:35:10.000Z"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"article:tag","content":"蓝屏"}],["meta",{"property":"article:published_time","content":"2020-10-25T00:00:00.000Z"}],["meta",{"property":"article:modified_time","content":"2022-12-17T03:35:10.000Z"}]]},"headers":[{"level":2,"title":"导出蓝屏日志","slug":"导出蓝屏日志","link":"#导出蓝屏日志","children":[]},{"level":2,"title":"上传社区分析","slug":"上传社区分析","link":"#上传社区分析","children":[]},{"level":2,"title":"蓝屏解决方案","slug":"蓝屏解决方案","link":"#蓝屏解决方案","children":[{"level":3,"title":"系统模块报错","slug":"系统模块报错","link":"#系统模块报错","children":[]},{"level":3,"title":"驱动冲突","slug":"驱动冲突","link":"#驱动冲突","children":[]},{"level":3,"title":"未知程序","slug":"未知程序","link":"#未知程序","children":[]}]},{"level":2,"title":"蓝屏解决集锦","slug":"蓝屏解决集锦","link":"#蓝屏解决集锦","children":[]},{"level":2,"title":"常见问题","slug":"常见问题","link":"#常见问题","children":[{"level":3,"title":"装不了 WinDbg","slug":"装不了-windbg","link":"#装不了-windbg","children":[]},{"level":3,"title":"分析日志时报错","slug":"分析日志时报错","link":"#分析日志时报错","children":[]},{"level":3,"title":"找不到 minidump 文件","slug":"找不到-minidump-文件","link":"#找不到-minidump-文件","children":[]}]}],"git":{"createdTime":1658685076000,"updatedTime":1671248110000,"contributors":[{"name":"rockbenben","email":"qingwhat@gmail.com","commits":12}]},"readingTime":{"minutes":4.85,"words":1454},"filePathRelative":"_posts/2020-10-25-dpc_watchdog_violation.md","localizedDate":"2020年10月25日","excerpt":"<p>DPC_WATCHDOG_VIOLATION 蓝屏原因，多为硬件驱动问题。可是，只有驱动出现大规模报错，厂家才会更新并推送解决方法。</p>\\n<p>因此，你在网上搜到的解决方案，大多是过时的，并不能解决你的问题。蓝屏原因千奇百怪，通过分析 dmp 蓝屏日志才能彻底解决蓝屏。</p>\\n<h2> 导出蓝屏日志</h2>\\n<ol>\\n<li>\\n<p>安装 <a href=\\"https://www.microsoft.com/zh-cn/p/windbg/9pgjgd53tn86?rtc=1&amp;activetab=pivot:overviewtab\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">WinDbg Preview</a>，这是微软官方推出的系统 Debug 工具。</p>\\n</li>\\n<li>\\n<p>启动 WinDbg Preview，软件会自动检测到最新 dmp 日志，点击 Yes 即可载入。如果想分析其他文件，打开文件夹 <code>C:\\\\Windows\\\\Minidump</code>，导出日志 <code>*.dmp</code>。</p>\\n</li>\\n<li>\\n<p>载入日志过程中，WinDbg Preview 会自动下载所需文件，不需要管。载入完成后，点击 <code>!analyze -v</code>，分析具体日志。</p>\\n<figure><img src=\\"http://tc.seoipo.com/20201025223307.png\\" alt=\\"\\" tabindex=\\"0\\" loading=\\"lazy\\"><figcaption></figcaption></figure>\\n</li>\\n<li>\\n<p>分析日志：日志前半部分都是套话（可忽略），蓝屏原因多在日志最下方几行，分析尾部日志来找出引发蓝屏的进程。注意不要强删未知文件。</p>\\n<figure><img src=\\"http://tc.seoipo.com/20201025224308.png\\" alt=\\"\\" tabindex=\\"0\\" loading=\\"lazy\\"><figcaption></figcaption></figure>\\n</li>\\n</ol>","autoDesc":true}');export{e as data};
